import React from 'react';
import { Helmet } from 'react-helmet-async';
import { Trophy } from 'lucide-react';

const Leaderboard = () => {
  return (
    <>
      <Helmet>
        <title>Leaderboard - QuizMaster Pro</title>
      </Helmet>
      <div className="min-h-screen bg-gray-50 dark:bg-gray-900 flex items-center justify-center">
        <div className="text-center">
          <Trophy className="h-16 w-16 text-blue-600 mx-auto mb-4" />
          <h1 className="text-2xl font-bold text-gray-900 dark:text-white mb-2">Leaderboard</h1>
          <p className="text-gray-600 dark:text-gray-400">This page will show the top performers and rankings.</p>
        </div>
      </div>
    </>
  );
};

export default Leaderboard;
